import { GoogleMap } from '@react-google-maps/api';



class Map extends React.Component{





    render(){

        const { LoadScript } = require("./LoadScript");
        const ScriptLoaded = require("./docs/ScriptLoaded").default;




        return(

         <div className="Main"> 

            <ScriptLoaded>
            <GoogleMap
                id="circle-example"
                mapContainerStyle={{
                height: "400px",
                width: "800px"
                }}
                zoom={7}
                center={{
                lat: -3.745,
                lng: -38.523
                }}
            />
            </ScriptLoaded>;
         </div>
        );
    }
}

export default Map;
